"""
YOLO 錯誤分析腳本（適用 Colab / Jupyter，無需 argparse）

路徑預設：
- WEIGHTS_PATH = "/content/runs/detect/train/weights/best.pt"
- VAL_DIR      = "/content/datasets/val"  # 底下需有 images/ 與 labels/

輸出：
- /content/error_analysis/annotated/*.jpg : 前 MAX_IMAGES 張影像，畫上 GT (綠) + Pred (紅)
- /content/error_analysis/image_stats.csv : 每張圖片 TP/FP/FN 統計
- 終端機：每類別 precision / recall / F1 及 overall 統計

依賴：
- pip install ultralytics opencv-python
  （若無 ultralytics，程式會嘗試用 torch.hub 載 YOLOv5）
"""

import os
import glob
import csv
from collections import defaultdict

import numpy as np
import cv2
import torch

# ===================== 使用者可調整區 =====================

WEIGHTS_PATH = "/content/runs/detect/train/weights/best.pt"
VAL_DIR = "/content/datasets/val"

IMG_DIR_NAME = "images"
LABEL_DIR_NAME = "labels"

OUTPUT_DIR = "/content/error_analysis"
MAX_IMAGES = 50

IMG_SIZE = 640
CONF_THRES = 0.25
IOU_THRES = 0.45

# ========================================================


def load_model(weights_path):
    """
    先嘗試使用 ultralytics.YOLO
    若失敗，再用 torch.hub (YOLOv5)
    """
    try:
        from ultralytics import YOLO  # type: ignore
        print("[INFO] 使用 ultralytics.YOLO 載入模型")
        model = YOLO(weights_path)
        return model, "ultralytics"
    except Exception as e:
        print("[WARN] 無法使用 ultralytics.YOLO, 改用 torch.hub YOLOv5. 詳細：", e)
        model = torch.hub.load("ultralytics/yolov5", "custom", weights_path)
        print("[INFO] 使用 torch.hub YOLOv5 載入模型")
        return model, "yolov5_hub"


def run_inference(model, model_type, img_bgr):
    """
    對單張 BGR 影像做推論
    回傳：
        pred_boxes: (N,4) xyxy (float)
        pred_scores: (N,)
        pred_cls: (N,) int
        class_names: dict / list (class_id -> name)
    """
    if model_type == "ultralytics":
        results_list = model.predict(
            img_bgr,
            imgsz=IMG_SIZE,
            conf=CONF_THRES,
            iou=IOU_THRES,
            verbose=False
        )
        res = results_list[0]
        boxes = res.boxes

        if boxes is None or len(boxes) == 0:
            return np.zeros((0, 4), dtype=np.float32), np.array([]), np.array([]), res.names

        pred_boxes = boxes.xyxy.cpu().numpy()
        pred_scores = boxes.conf.cpu().numpy()
        pred_cls = boxes.cls.cpu().numpy().astype(int)
        class_names = res.names

        return pred_boxes, pred_scores, pred_cls, class_names

    else:  # "yolov5_hub"
        # YOLOv5 hub：直接 model(img, size=IMG_SIZE)
        results = model(img_bgr, size=IMG_SIZE)
        if results is None or len(results.xyxy) == 0:
            return np.zeros((0, 4), dtype=np.float32), np.array([]), np.array([]), model.names

        pred = results.xyxy[0].cpu().numpy()
        if pred.shape[0] == 0:
            return np.zeros((0, 4), dtype=np.float32), np.array([]), np.array([]), model.names

        pred_boxes = pred[:, 0:4]
        pred_scores = pred[:, 4]
        pred_cls = pred[:, 5].astype(int)
        class_names = model.names
        return pred_boxes, pred_scores, pred_cls, class_names


def load_yolo_labels(label_path, img_w, img_h):
    """
    讀 YOLO txt label：每行格式：
        class cx cy w h (皆為 0~1)
    轉為 xyxy (像素座標)
    回傳：
        boxes_xyxy: (M,4)
        cls_ids: (M,)
    """
    if not os.path.exists(label_path):
        return np.zeros((0, 4), dtype=np.float32), np.array([], dtype=int)

    boxes = []
    cls_ids = []

    with open(label_path, "r") as f:
        for line in f:
            line = line.strip()
            if not line:
                continue
            parts = line.split()
            if len(parts) != 5 and len(parts) != 6:
                # 有些格式可能多一個 conf，但這裡以 5 為主，6 就忽略最後一個
                pass
            cls_id = int(float(parts[0]))
            cx = float(parts[1])
            cy = float(parts[2])
            w = float(parts[3])
            h = float(parts[4])

            # 轉成 xyxy 像素
            x1 = (cx - w / 2.0) * img_w
            y1 = (cy - h / 2.0) * img_h
            x2 = (cx + w / 2.0) * img_w
            y2 = (cy + h / 2.0) * img_h

            boxes.append([x1, y1, x2, y2])
            cls_ids.append(cls_id)

    if len(boxes) == 0:
        return np.zeros((0, 4), dtype=np.float32), np.array([], dtype=int)

    return np.array(boxes, dtype=np.float32), np.array(cls_ids, dtype=int)


def box_iou(boxes1, boxes2):
    """
    計算 IoU 矩陣
    boxes1: (N,4) xyxy
    boxes2: (M,4) xyxy
    回傳： (N,M)
    """
    if boxes1.shape[0] == 0 or boxes2.shape[0] == 0:
        return np.zeros((boxes1.shape[0], boxes2.shape[0]), dtype=np.float32)

    # 交集
    x11, y11, x12, y12 = np.split(boxes1, 4, axis=1)
    x21, y21, x22, y22 = np.split(boxes2, 4, axis=1)

    inter_x1 = np.maximum(x11, x21.T)
    inter_y1 = np.maximum(y11, y21.T)
    inter_x2 = np.minimum(x12, x22.T)
    inter_y2 = np.minimum(y12, y22.T)

    inter_w = np.clip(inter_x2 - inter_x1, a_min=0, a_max=None)
    inter_h = np.clip(inter_y2 - inter_y1, a_min=0, a_max=None)
    inter_area = inter_w * inter_h

    area1 = (x12 - x11) * (y12 - y11)  # (N,1)
    area2 = (x22 - x21) * (y22 - y21)  # (M,1)

    union = area1 + area2.T - inter_area + 1e-6
    iou = inter_area / union
    return iou


def match_predictions(gt_boxes, gt_cls, pred_boxes, pred_cls, pred_scores, iou_thres):
    """
    用簡單 greedy matching 比對
    只在相同 class 間配對。先按 conf 由高到低看每個 prediction。
    回傳：
        matches: list of (pred_idx, gt_idx)
        unmatched_pred: list of pred_idx
        unmatched_gt: list of gt_idx
    """
    num_pred = pred_boxes.shape[0]
    num_gt = gt_boxes.shape[0]

    if num_gt == 0 or num_pred == 0:
        return [], list(range(num_pred)), list(range(num_gt))

    iou_mat = box_iou(pred_boxes, gt_boxes)  # (num_pred, num_gt)

    matched_gt = set()
    matches = []

    # 依置信度排序
    pred_indices = list(range(num_pred))
    pred_indices.sort(key=lambda i: pred_scores[i], reverse=True)

    for pi in pred_indices:
        best_iou = 0.0
        best_gi = -1
        for gi in range(num_gt):
            if gi in matched_gt:
                continue
            if pred_cls[pi] != gt_cls[gi]:
                continue
            iou_val = iou_mat[pi, gi]
            if iou_val > best_iou:
                best_iou = iou_val
                best_gi = gi

        if best_gi >= 0 and best_iou >= iou_thres:
            matches.append((pi, best_gi))
            matched_gt.add(best_gi)

    matched_pred = {m[0] for m in matches}
    matched_gt_set = {m[1] for m in matches}

    unmatched_pred = [i for i in range(num_pred) if i not in matched_pred]
    unmatched_gt = [i for i in range(num_gt) if i not in matched_gt_set]

    return matches, unmatched_pred, unmatched_gt


def draw_boxes(img, gt_boxes, gt_cls, pred_boxes, pred_cls, pred_scores, class_names):
    """
    在影像上畫出 GT(綠) & Pred(紅)
    """
    out = img.copy()

    # 畫 GT (綠色)
    for box, cid in zip(gt_boxes, gt_cls):
        x1, y1, x2, y2 = map(int, box)
        label = f"GT:{class_names.get(cid, str(cid)) if isinstance(class_names, dict) else class_names[cid]}"
        cv2.rectangle(out, (x1, y1), (x2, y2), (255, 0, 0), 2)
        cv2.putText(out, label, (x1, max(0, y1 - 5)),
                    cv2.FONT_HERSHEY_SIMPLEX, 0.5, (255, 0, 0), 1, cv2.LINE_AA)

    # 畫 Pred (紅色)
    for box, cid, score in zip(pred_boxes, pred_cls, pred_scores):
        x1, y1, x2, y2 = map(int, box)
        label = f"P:{class_names.get(cid, str(cid)) if isinstance(class_names, dict) else class_names[cid]} {score:.2f}"
        cv2.rectangle(out, (x1, y1), (x2, y2), (0, 0, 255), 2)
        cv2.putText(out, label, (x1, y2 + 15),
                    cv2.FONT_HERSHEY_SIMPLEX, 0.5, (0, 0, 255), 1, cv2.LINE_AA)

    return out


def main():
    # 建立輸出資料夾
    os.makedirs(OUTPUT_DIR, exist_ok=True)
    annotated_dir = os.path.join(OUTPUT_DIR, "annotated")
    os.makedirs(annotated_dir, exist_ok=True)

    img_dir = os.path.join(VAL_DIR, IMG_DIR_NAME)
    label_dir = os.path.join(VAL_DIR, LABEL_DIR_NAME)

    # 收集影像檔
    img_patterns = [os.path.join(img_dir, ext) for ext in ("*.jpg", "*.jpeg", "*.png", "*.bmp")]
    img_files = []
    for pat in img_patterns:
        img_files.extend(glob.glob(pat))
    img_files = sorted(img_files)

    if len(img_files) == 0:
        print(f"[ERROR] 在 {img_dir} 找不到任何影像，請確認路徑及副檔名。")
        return

    print(f"[INFO] 共找到 {len(img_files)} 張影像，將分析前 {min(MAX_IMAGES, len(img_files))} 張。")

    model, model_type = load_model(WEIGHTS_PATH)

    # 統計用
    per_class_tp = defaultdict(int)
    per_class_fp = defaultdict(int)
    per_class_fn = defaultdict(int)

    # 每張圖的統計
    per_image_stats = []

    # class_names 先設為空，之後第一次推論時更新
    class_names = {}

    for idx, img_path in enumerate(img_files[:MAX_IMAGES]):
        print(f"[INFO] 處理第 {idx+1} 張: {img_path}")
        img = cv2.imread(img_path)
        if img is None:
            print(f"[WARN] 無法讀取影像: {img_path}，略過。")
            continue

        h, w = img.shape[:2]

        # 推論
        pred_boxes, pred_scores, pred_cls, class_names = run_inference(model, model_type, img)

        # GT label path
        base_name = os.path.splitext(os.path.basename(img_path))[0]
        label_path = os.path.join(label_dir, base_name + ".txt")
        gt_boxes, gt_cls = load_yolo_labels(label_path, w, h)

        # matching
        matches, unmatched_pred, unmatched_gt = match_predictions(
            gt_boxes, gt_cls, pred_boxes, pred_cls, pred_scores, IOU_THRES
        )

        # 更新統計
        for pi, gi in matches:
            cid = int(gt_cls[gi])
            per_class_tp[cid] += 1

        for pi in unmatched_pred:
            cid = int(pred_cls[pi])
            per_class_fp[cid] += 1

        for gi in unmatched_gt:
            cid = int(gt_cls[gi])
            per_class_fn[cid] += 1

        img_tp = len(matches)
        img_fp = len(unmatched_pred)
        img_fn = len(unmatched_gt)

        per_image_stats.append({
            "image": os.path.basename(img_path),
            "num_gt": int(gt_boxes.shape[0]),
            "num_pred": int(pred_boxes.shape[0]),
            "tp": img_tp,
            "fp": img_fp,
            "fn": img_fn
        })

        # 畫圖 & 存檔
        annotated = draw_boxes(img, gt_boxes, gt_cls, pred_boxes, pred_cls, pred_scores, class_names)
        save_path = os.path.join(annotated_dir, os.path.basename(img_path))
        cv2.imwrite(save_path, annotated)

    # 輸出 per-image CSV
    csv_path = os.path.join(OUTPUT_DIR, "image_stats.csv")
    with open(csv_path, "w", newline="", encoding="utf-8") as f:
        writer = csv.DictWriter(f, fieldnames=["image", "num_gt", "num_pred", "tp", "fp", "fn"])
        writer.writeheader()
        for row in per_image_stats:
            writer.writerow(row)

    print(f"[INFO] 每張圖片統計已寫入：{csv_path}")
    print(f"[INFO] 標註圖片已輸出至：{annotated_dir}")

    # 計算 per-class 指標
    print("\n===== Per-class Metrics =====")
    all_classes = sorted(set(list(per_class_tp.keys()) +
                             list(per_class_fp.keys()) +
                             list(per_class_fn.keys())))

    total_tp = 0
    total_fp = 0
    total_fn = 0

    # 如果 class_names 是 list/dict，都支援
    def get_class_name(cid):
        if isinstance(class_names, dict):
            return class_names.get(cid, str(cid))
        if isinstance(class_names, (list, tuple)):
            if 0 <= cid < len(class_names):
                return class_names[cid]
        return str(cid)

    for cid in all_classes:
        tp = per_class_tp[cid]
        fp = per_class_fp[cid]
        fn = per_class_fn[cid]

        total_tp += tp
        total_fp += fp
        total_fn += fn

        precision = tp / (tp + fp + 1e-6)
        recall = tp / (tp + fn + 1e-6)
        f1 = 2 * precision * recall / (precision + recall + 1e-6)

        print(f"Class {cid} ({get_class_name(cid)}): "
              f"TP={tp}, FP={fp}, FN={fn}, "
              f"Precision={precision:.4f}, Recall={recall:.4f}, F1={f1:.4f}")

    # overall
    overall_precision = total_tp / (total_tp + total_fp + 1e-6)
    overall_recall = total_tp / (total_tp + total_fn + 1e-6)
    overall_f1 = 2 * overall_precision * overall_recall / (overall_precision + overall_recall + 1e-6)

    print("\n===== Overall Metrics (所有類別合併) =====")
    print(f"Total TP={total_tp}, FP={total_fp}, FN={total_fn}")
    print(f"Precision={overall_precision:.4f}, Recall={overall_recall:.4f}, F1={overall_f1:.4f}")
    print("\n[INFO] 錯誤分析完成。")


if __name__ == "__main__":
    main()